import React from 'react';
import './App.css';

import { MDBBtn, MDBContainer } from 'mdb-react-ui-kit';
import Navbar from './components/Navbar';
import Header from './components/Header';

function App() {
  return (
    <MDBContainer fluid>
      <div>
        <Navbar/>
        <Header/>
      </div>
    </MDBContainer>
  );
}

export default App;
